import React, {
    Component
} from 'react';
import './TodoItem.css';

class TodoList extends Component {
    render() {
        const {
            item
        } = this.props;
        let className = 'TodoItem';
        if (item.isComplete) {
            className += ' TodoItem-complete';
        }
        //npm classname
        return ( <
            div className = {
                className
            } >
            <
            p > {
                this.props.item.title
            } < /p> <
            /div>
        )
    }
}
export default TodoList
